import React from "react";
import logo from "./logo.svg";
import "./App.css";
const ping = require("ping");

function App() {
  const [data, setData] = React.useState(null);

  React.useEffect(() => {
    fetch("/api")
      .then((res) => res.json())
      .then((data) => setData(data.message));

  }, []);
  (async function () {
    const result = await ping.promise.probe('www.kindacode.com', {
      timeout: 10,
      extra: ["-i", "2"],
    });

    console.log(result);
